import { Center, Text, VStack, Heading } from '@chakra-ui/react';

const Home = (): JSX.Element => (
    <Center mt="160px">
     <VStack spacing="32px">
      <div>
          <Heading>Artists Book</Heading>
          <Text fontSize='4xl'>Manage your favorite artists</Text>
      </div>
     </VStack>
    </Center>
);

export default Home;
